var title_f15_63_16373="EP study tracings mapping slow AV nodal pathway";
var content_f15_63_16373=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=CARD%2F77513&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=CARD%2F77513&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 602px\">",
"   <div class=\"ttl\">",
"    Intracardiac and surface ECG recordings during electrophysiologic study showing identification of slow pathway for ablation of AV nodal reentrant tachycardia",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 582px; height: 413px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Shown are three surface ECG leads (I, aVF, V1), and intracardiac recordings from the high right atrium (HRA3-4), proximal (HBE3-4,) and distal His bundle region (HBE1-2), proximal to distal coronary sinus (CS9-10, CS7-8, CS5-6, CS3-4, and CS1-2), and the right ventricular apex (RVA3-4). The patient had a history of medically refractory supraventricular arrhythmia and the diagnostic study revealed easily inducible, typical atrioventricular (AV) nodal reentrant tachycardia. The HBE catheter was maneuvered from the His position to the slow pathway region, which is typically inferior and posterior to the His bundle and just anterior to the coronary sinus ostium. This is an ideal site for slow pathway ablation and has a small atrial electrogram (A) and large ventricular electrogram (V), with no evidence of His bundle activity. The tip of the HBE catheter (HBE1-2) records such a signal, and is used for ablation.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
var script_f15_63_16373=[""].join("\n");
var outline_f15_63_16373=null;
var title_f15_63_16374="Single balloon enteroscopy technique";
var content_f15_63_16374=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=GAST%2F63179&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=GAST%2F63179&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 521px\">",
"   <div class=\"ttl\">",
"    Single balloon enteroscopy technique",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 501px; height: 696px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    <p>",
"     (A)&nbsp;With the balloon at the tip of the overtube inflated to anchor the small bowel, the enteroscope is advanced as deeply into the&nbsp;small bowel as possible (except for the initial insertion, when the enteroscope is advanced with the overtube balloon deflated).&nbsp;&nbsp;",
"     <br>",
"      (B) Once forward motion is no longer possible, the tip of the enteroscope is agulated to&nbsp;create a \"hook\" that will help anchor the enteroscope.&nbsp;Once the small bowel is anchored by the tip of the enteroscope, the overtube&nbsp;balloon is deflated.",
"      <br>",
"       (C) The overtube is advanced to the end of the enteroscope.&nbsp;",
"       <br>",
"        (D) The overtube balloon is inflated to anchor the small bowel.&nbsp;",
"        <br>",
"         (E) Both the enteroscope and the overtube are gently withdrawn to pleat the small bowel onto the overtube. The enteroscope is then advanced as in (A), and the process is&nbsp;repeated until forward progress with the enteroscope is no longer possible or the area of interest within the small bowel is reached.",
"        </br>",
"       </br>",
"      </br>",
"     </br>",
"    </p>",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     <p>",
"      &nbsp;",
"     </p>",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
