" <div id=\"topicContent\">",
"  <div id=\"topicTitle\">",
"   Rhabdomyosarcoma and undifferentiated sarcoma in childhood and adolescence: Epidemiology, pathology, and molecular pathogenesis",
"  </div>",
"  <div id=\"topicContributors\">",
"   <div>",
"    <a id=\"authors\">",
"    </a>",
"    <a class=\"contributor contributor_credentials contributorType\" href=\"UTD.htm?15/63/16377/contributors\">",
"     Authors",
"    </a>",
"    <br/>",
