var title_f15_63_16378="Wound healing granulation";
var content_f15_63_16378=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=SURG%2F53136&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=SURG%2F53136&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 531px\">",
"   <div class=\"ttl\">",
"    Wound healing granulation",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 511px; height: 679px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    (A) Granulation tissue has two major components: cells and proliferating capillaries. The cells are mostly fibroblasts, myofibroblasts, and macrophages. The macrophages are derived from monocytes and macrophages. The fibroblasts and myofibroblasts derive from mesenchymal stem cells, and the capillaries arise from adjacent vessels by division of the lining endothelial cells (detail), in a process termed angiogenesis. Endothelial cells put out cell extensions, called pseudopodia, that grow toward the wound site. Cytoplasmic growth enlarges the pseudopodia, and eventually the cells divide. Vacuoles formed in the daughter cells eventually fuse to create a new lumen. The entire process continues until the sprout encounters another capillary, with which it will connect. At its peak, granulation tissue is the most richly vascularized tissue in the body.",
"    <br>",
"     (B) Once repair has been achieved, most of the newly formed capillaries are obliterated and then reabsorbed, leaving a pale avascular scar.",
"     <br>",
"      (C) A photomicrograph of granulation tissue shows thin-walled vessels embedded in a loose connective tissue matrix containing mesenchymal cells and occasional inflammatory cells.",
"      <div class=\"footnotes\">",
"      </div>",
"      <div class=\"reference\">",
"       Reproduced with permission from: Rubin E, Farber JL. Pathology, 3rd Edition. Philadelphia: Lippincott Williams &amp; Wilkins, 1999. Copyright &copy; 1999 Lippincott Williams &amp; Wilkins.",
"      </div>",
"     </br>",
"    </br>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
