var title_f15_63_16380="Supratherapeutic INR management";
var content_f15_63_16380=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=HEME%2F61288&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=HEME%2F61288&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Recommended management of a supratherapeutic INR",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        INR",
"       </td>",
"       <td class=\"subtitle1\">",
"        Bleeding present",
"       </td>",
"       <td class=\"subtitle1\">",
"        Recommended action*",
"       </td>",
"      </tr>",
"      <tr>",
"       <td rowspan=\"3\">",
"        &gt;Ther to 5.0",
"       </td>",
"       <td rowspan=\"3\">",
"        No",
"       </td>",
"       <td>",
"        Lower warfarin dose,",
"        <strong>",
"         or",
"        </strong>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Omit a dose and resume warfarin at a lower dose when INR is in therapeutic range,",
"        <strong>",
"         or",
"        </strong>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        No dose reduction needed if INR is minimally prolonged",
"       </td>",
"      </tr>",
"      <tr>",
"       <td rowspan=\"2\">",
"        &gt;5.0 to 9.0",
"       </td>",
"       <td rowspan=\"2\">",
"        No",
"       </td>",
"       <td>",
"        Omit the next 1 to 2 doses of warfarin, monitor INR more frequently, and resume treatment at a lower dose when INR is in therapeutic range,",
"        <strong>",
"         or",
"        </strong>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Omit a dose and administer 1 to 2.5 mg oral vitamin K1",
"        <sup>",
"         &bull;",
"        </sup>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        &gt;9.0",
"       </td>",
"       <td>",
"        No",
"       </td>",
"       <td>",
"        Hold warfarin and administer 2.5 to 5 mg oral vitamin K1. Monitor INR more frequently and administer more vitamin K1 as needed, Resume warfarin at a lower dose when INR is in therapeutic range",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Any",
"       </td>",
"       <td>",
"        Serious or life-threatening",
"       </td>",
"       <td>",
"        Hold warfarin and administer 10 mg vitamin K1 by slow IV infusion; supplement with prothrombin complex concentrate, fresh frozen plasma, or recombinant human factor VIIa, depending on clinical urgency. Monitor and repeat as needed.",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     INR: International Normalized Ratio; Ther: therapeutic INR range for the patient in question.",
"     <br>",
"      * Editor's note: These recommendations, which UpToDate supports,&nbsp;are consistent with the 2008 American College of Chest Physician Guidelines but differ from their 2012 guidelines. See text for details.",
"      <br>",
"       &bull;&nbsp;This option is preferred in patients at increased risk for bleeding (eg, history of bleeding, stroke, renal insufficiency, anemia, hypertension).",
"      </br>",
"     </br>",
"    </div>",
"    <div class=\"reference\">",
"     Adapted from: Ansell J, Hirsh J, Hylek E, et al. Pharmacology and management of the vitamin K antagonists: American College of Chest Physicians Evidence-Based Clinical Practice Guidelines (8th Edition). Chest 2008; (6 Suppl):160s.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
